SELECT COUNT(*) AS TotalDesigns FROM CakeDesigns;

SELECT complexity_level, COUNT(*) AS Count 
FROM CakeDesigns 
GROUP BY complexity_level
ORDER BY Count DESC;

SELECT TOP 10 c.cake_name, cd.theme, cd.complexity_level
FROM CakeDesigns cd
JOIN Cakes c ON cd.cake_id = c.cake_id;

